const musicFiles = [, "a3", "a-3", "a4", "a-4", "a5", "a-5", "b3", "b4", "b5", "c3", "c-3", "c4", "c-4", "c5", "c-5", "c6", "d3", "d-3", "d4", "d-4", "d5", "d-5", "e3", "e4", "e5", "f3", "f-3", "f4", "f-4", "f5", "f-5", "g3", "g-3", "g4", "g-4", "g5", "g-5"];

const speedValues = document.querySelectorAll(".speed-values__value");
const speedSlider = document.querySelector(".speed-slider");
let speed = speedSlider.value;
console.log(speed);

const [playBtn, pauseBtn, stopBtn] = [...document.querySelectorAll(".button")];

let intervalTimer, curNote = 0;

playBtn.addEventListener('click', () => {
  playBtn.disabled = true;

  playNotes(curNote);

  intervalTimer = setInterval(() => {
    curNote++;
    playNotes(curNote);

    if (curNote >= n.length) {
      playBtn.disabled = false;
      clearInterval(intervalTimer);
      curNote = 0;
    }
  }, speedSlider.value * 100);
});

stopBtn.addEventListener('click', () => {
  clearInterval(intervalTimer);
  curNote = 0;
  playBtn.disabled = false;
});

function playNotes(curNote) {
  const audio = new Audio(`mp3/${musicFiles[n[curNote]]}.mp3`);
  audio.play();
}

speedValues.forEach(speedValue => {
  speedValue.addEventListener('click', () => {
    if (speedValue.classList.contains("speed-values__value_last")) speedSlider.value = 10;
    else speedSlider.value = speedValue.innerText;
  });
});

